import React from "react";
import Header from "../Header";
import './Apartament.css'
import CheckInSection from '../CheckInSection'
import HotelRoom from "./HotelRoom";

export default function Apartament(){
    return(
        <div className="book-background">
        <Header background2={`background2`} background={`back2`} backApart={`backapart`}/>
        <CheckInSection
         HotelRoom={<HotelRoom suite='Junior Suite' size='260'bed='2' price='350'/>}
         HotelRoom1={<HotelRoom suite='Standart Room' size='230'bed='1' price='250'/>}
         HotelRoom2={<HotelRoom suite='Superior Room' size='270'bed='1' price='550'/>}
         HotelRoom3={<HotelRoom suite='Standart Room' size='280'bed='2' price='250'/>}/>
        </div>
    )
}
